  input: '"TEXT","F3XA","C00143743","Transfers shown on Schedule H4 to the non-federal
    account were made for refunds/reimbursements received by the Committee and shown
    on Schedule A Line 15. The refunds/reimbursements were made by former employees
    of the Committee for COBRA health insurance payments made by the Committee to
    Humana and by the Texas Federation of Republican Women for sub-lease rent and
    postage.  The payments to the vendors (900 Congress and Pitney Bowes) are reported
    within this report.  Reimbursements were made either prior to the expenditure
    or within a commercially reasonable time.  Please note that the fundraising activities
    disclosed on line 21b are not FEA fundraising activities.  Items on Schedule B
    that the Commission questions were for Fundraising activities, not express advocacy
    for a federal candidate.  In response to your letter of August 11, 2004, all expenses
    associated with salary and benefits for employees of the committee who spend more
    than 25 percent of their time during that month on activities in connection with
    a Federal Election have been moved to appear on Line 30 (b).  Expenses identified
    as postage, print & mail and fax services were administrative expenses and were
    not public communications or any other communications that referred to a clearly
    identified candidate for federal office.  As such, they are correctly disclosed
    on schedule H-4.  The individuals receiving the computer consulting payments are
    not employees of the committee.  Therefore, since these are not salary payments,
    they are correctly disclosed as consulting fees on Schedule H-4.  Items on Schedule
    A Line 15 for Jim Wilson Campaign Account and Yes on 12 are for sales of lists
    and are properly reflected as offsets. This amendment reflects requested corrections
    and is filed pursuant to your letter dated 08/18/04."'
